import React, { useEffect, useState } from "react";
import {Table} from 'antd';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import 'antd/dist/antd.css';
import './TraderList.scss';
import TraderListData from './TraderListData.json' ;
import {
    faTrashAlt as deleteIcon
} from '@fortawesome/free-solid-svg-icons';

function TraderList(props){
    const columns=[
        {
            title: 'First Name',
            dataIndex: 'firstName',
            key: 'firstName',
        },
        {
            title: 'Last Name',
            dataIndex: 'lastName',
            key: 'lastName',
        },
        {
            title: 'Email',
            dataIndex: 'email',
            key: 'email',
        },
        {
            title: 'Date of Birth',
            dataIndex: 'dob',
            key: 'dob',
        },
        {
            title: 'Country',
            dataIndex: 'country',
            key: 'country',
        },
        {
            title: 'Actions',
            dataIndex: 'actions',
            key: 'actions',
            render: (text, record) => (
                    <div className="trader-delete-icon">
                        <FontAwesomeIcon icon={ deleteIcon } onClick={() => props.onTraderDeleteClick(record.id) } />
                    </div>
            ),
        },
    ];

    const [tableColumns, setTableColumns] = useState(columns)
    const [dataSource, setDataSource] = useState([])
    const onTraderDelete = (id) => {
   //delete trader logic
   console.log("Trader " + id + " is deleted.");}

    useEffect(() => {
        const dataSource = TraderListData
        setDataSource(dataSource)
    })


  return (
   <Table
   dataSource={dataSource}
   columns={tableColumns}
   pagination={false}
   />
  )
}

export default TraderList
